        let pwrLabelTxtRect = CGRectMake(sqreBtn.minX + floor(sqreBtn.width * 0.00000 + 0.5), sqreBtn.minY + floor(sqreBtn.height * 0.75000 + 0.5), floor(sqreBtn.width * 1.00000 + 0.5) - floor(sqreBtn.width * 0.00000 + 0.5), floor(sqreBtn.height * 1.00000 + 0.5) - floor(sqreBtn.height * 0.75000 + 0.5))
        let pwrLabelTxtStyle = NSParagraphStyle.defaultParagraphStyle().mutableCopy() as! NSMutableParagraphStyle
        pwrLabelTxtStyle.alignment = .Center

        let pwrLabelTxtFontAttributes = [NSFontAttributeName: UIFont(name: "Arial-BoldMT", size: 11)!, NSForegroundColorAttributeName: btnTextOffColor, NSParagraphStyleAttributeName: pwrLabelTxtStyle]

        let pwrLabelTxtTextHeight: CGFloat = NSString(string: pwrBtnText).boundingRectWithSize(CGSizeMake(pwrLabelTxtRect.width, CGFloat.infinity), options: NSStringDrawingOptions.UsesLineFragmentOrigin, attributes: pwrLabelTxtFontAttributes, context: nil).size.height
        CGContextSaveGState(context)
        CGContextClipToRect(context, pwrLabelTxtRect);
        NSString(string: pwrBtnText).drawInRect(CGRectMake(pwrLabelTxtRect.minX, pwrLabelTxtRect.minY + (pwrLabelTxtRect.height - pwrLabelTxtTextHeight) / 2, pwrLabelTxtRect.width, pwrLabelTxtTextHeight), withAttributes: pwrLabelTxtFontAttributes)
        CGContextRestoreGState(context)
    }

}
